import React from 'react';
import todo from './images/todo.png';


const Todolist = () =>{
    return(
        <>
        <div className='main_div'>
            <div className='center_div'>
            <img src={todo} alt='todo_logo' height='70' width='50'/>
                
            </div>
        </div>
        </>
    )
}

export default Todolist;
